import axios from "axios";
import {
  onGlobalSuccess,
  onGlobalError,
} from "../services/serviceHelper";

const getProductsByMake = (payload) => {
  const config = {
    method: "GET",
    url: `"https://localhost:50001/api/product"/${payload.make}`,
    withCredentials: true,
    crossdomain: true,
    headers: { "Content-Type": "application/json" },
  };
  return axios(config).then(onGlobalSuccess).catch(onGlobalError);
};

export { getProductsByMake };
